 @Herdiana Heri  gw rasa itu bukan gaji (salary) ya, tp lebih ke pendapatan (income). Kalo gaji nilainya kan cenderung tetap setiap bulannya. Kalo income, biasanya fluktuatif.

Misalkan tiap klien muter duit 500jt/hari utk dapet profit 5% perhari. 5% = 25jt. Dari 25jt, si konsultan dapet 5% dr profit (1,25jt). Trus dia punya 15 klien. Income dia perbulan = 1,25jt x 15 klien × 24 hari kerja = 450 juta/ bulan.

Masuk akal.

